import Box from "@mui/material/Box";
import { TreeViewBaseItem } from "@mui/x-tree-view/models";
import { RichTreeView } from "@mui/x-tree-view/RichTreeView";

const treeTag = () => {
    return <div onClick={e => {}}>yea</div>;
}

const MUI_X_PRODUCTS = [
  {
    id: "grid",
    label: "phonemes",
    children: [
      { id: "grid-community", label: "@mui/x-data-grid-pro"},
      { id: "grid-pro", label: "@mui/x-data-grid-pro" },
      { id: "grid-premium", label: "@mui/x-data-grid-premium" },
    ],
  },
];

function PhonemeDropDown() {
  return (
    <Box sx={{ height: 220, flexGrow: 1, maxWidth: 400, backgroundColor: "white" }} className="phone-drop">
      <RichTreeView items={MUI_X_PRODUCTS} />
    </Box>
  );
}

export default PhonemeDropDown;
